import React, { createContext, useEffect, useState } from "react";
import tours from '../DB/Tuscany.json';


export const ToursContext = createContext(null);

export default function ToursProvider({ children }) {
  const [tour, setTours] = useState(tours);

  return (
    <ToursContext.Provider value={{ tours, setTours }}>
    {children}
  </ToursContext.Provider>
  
  );
}
